import React from "react";
import NavBar from "./Nav-Bar.js";
import Home from "./Home.js";

import Skills from "./Skills.js";
import About from "./About.js";
import "./App.css";
import Projects from "./Projects.js"

export default function app() {
  return (
    <div className="App">
      <NavBar />
      <body>
        <Home />
        <About />
        <Skills />
        <Projects />
      </body>
    </div>
  );
}
